import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import ChatWidget from './components/ChatWidget';

const App = () => {
  return (
    <Router>
      <Routes>
        <Route path="/chat-widget" element={<ChatWidget />} />
      </Routes>
    </Router>
  );
}

export default App;
